import axios, { Axios } from 'axios'
import React, { Component } from 'react'

export default class Data extends Component {

    constructor(props) {
      super(props)

      this.state = {
         first:[]
      }
    }

    async funct(){
       let output=await axios.get('https://jsonplaceholder.typicode.com/users')
       let datas=output.data
       console.log(datas)

       let all=datas
       console.log(all)

       this.setState({first:datas})

    }


    componentDidMount() { 
        this.funct()
     }

  render() {
    return (
      <div>

          <h1>{this.state.first.name}</h1>
      </div>
    )
  }
}


